import React from "react";
import logo from "./images/logo.png";

const Login = () => {
  return (
    <div>
      <center>
        <div className="logo mt-56 text-green font-semibold font-sans text-6xl">
          <h1>Haryanti</h1>
        </div>
        <div className="title font-semibold font-sans text-2xl mt-2 text-blackText">
          Selamat Datang !
        </div>
      </center>
    </div>
  );
};

export default Login;
